import React from 'react'

const LoginPage = () => {

    
    function loginWithGithub() {
        window.location.assign("https://github.com/login/oauth/authorize?client_id=" + CLIENT_ID)
    }
    return (
        <Button onClick={loginWithGithub}>
            Login with GitHub
        </Button>
    )
}

export default LoginPage
